class SC16:
    re = 0
    im = 0



def fft(data):
    cs = SC16()
    m_data = SC16()
    a_data = SC16()

    ie = 1
    N2 = int(len(data)/4)
    
    while(N2 > 0):
        ia = 0
        j = 0
        while j < ie :
            cs.re = FFT_TABLE[2*j]
            cs.im = FFT_TABLE[2*j+1]

            for _ in range(0,N2):
                m = ia + N2

                m_data.re = data[2*m]
                m_data.im = data[2*m+1]     

                a_data.re = data[2*ia]
                a_data.im = data[2*ia+1]

                m1 = SC16()
                result = a_data.re*MULT_SHIFT
                result -= cs.re*m_data.re + cs.im*m_data.im
                result += ADD_ROUNT_MULT
                result = result >> 16
                m1.re = result
                result = a_data.im *MULT_SHIFT
                result -= (cs.re*m_data.im - cs.im*m_data.re)
                result += ADD_ROUNT_MULT
                result = result >> 16
                m1.im = result

                data[m*2] = m1.re
                data[m*2+1] = m1.im

                m2 = SC16()
                result = a_data.re *MULT_SHIFT
                result += cs.re*m_data.re + cs.im*m_data.im
                result += ADD_ROUNT_MULT
                result = result >> 16
                m2.re = result

                result = a_data.im *MULT_SHIFT
                result += cs.re*m_data.im - cs.im*m_data.re
                result += ADD_ROUNT_MULT
                result = result >> 16
                m2.im = result
                
                data[ia*2] = m2.re
                data[ia*2+1] = m2.im
                ia += 1
                
            ia += N2
            j += 1
        ie <<= 1
        N2 >>= 1


